const ProductList = ({products, title}) => {

    return ( 
        <div className="product-list">
            <h2>{title}</h2>
            {products.map((joke) => (
                <div className="blog-preview" key={joke.id}>
                    <p>{joke.title}</p>
                </div>
            ))}
            {/* <p>{jokes.title}</p>
            <img className="image-size" src={jokes.image}/>
            <p>{jokes.description}</p> */}
        </div>
    );
}
 
export default JokeList;
